window.bookSummaryJSON = "<p>They say the truth can set you free…. That’s exactly what I’m worried about.</p> <p>Secrets never last long, but mine get exposed before I’m ready, leaving me betrayed by someone I love.</p> <p>Now I have to pick up the pieces and hope it doesn’t end with me losing the men I love, or my freedom.</p> <p>She thought she could scare us away.</p> <p>Brutal words spoken in an effort to shake our foundation only serve as proof of why we belong together.</p> <p>There’s nothing we won’t do to keep her, and we’re ready to prove it.</p> <p><i>Feeling Forever</i> is the third book of the Tasting Madness Series. This is a why-choose novel with adult themes and situations.</p>"; 
